import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import UsersPage from './UsersPage';
import PostsPage from './PostsPage';
import Nav from './nav';


class App extends React.Component{
    render(){
      return(
        <div className="App">

          <Router>
            <div>
              <Nav />
              <Switch>
                <Route exact path="/Users">
                  <UsersPage/>
                  </Route>
                <Route exact path="/Posts">
                  <PostsPage/>
                  </Route>

                  {userObj= UsersPage.
                  userObj.state.users.map(user => 
                <Route exact path={"/Posts"+ user.id }>

                </Route>
                  )}
              </Switch>
              </div>
              </Router>
        </div>
      )
    }
  }

export default App;
